import React from "react";
class Test3 extends React.Component {
  constructor() {
    super();
    this.state = { cshow: "None Component Showing" };
  }

  render() {
    return (
      <div>
        Does your company or organization need a website or email but you’re not
        sure where to start? Do you already have a website but need someone to
        handle updates or on going maintenance? If so, Gill Telecom Service can
        help. We can provide a full range of web services including Domain Name
        Registration, Web Design, Web Development, Web Hosting, Email hosting,
        Search Engine Optimization, web application development and integration.
        You will have a single point of contact for all of your website needs
        and the assurance that, since your website is hosted on one of Gill
        Telecom Service’s Linux web servers, your site will be available for
        your clients.
      </div>
    );
  }
}

export default Test3;
